import axios from "axios";

const customAxios = axios.create({
  baseURL: 'http://localhost:8080/',  
});

customAxios.interceptors.response.use(
    // function (response) {
    //   // 응답 데이터를 가공
    //   // ...
    // alert("잘되누");
    //   return response;
    // },
    function (error) {
      // 오류 응답을 처리
      alert("잘되누");
      // ...
      return Promise.reject(error);
    });
export default customAxios;
